import React from "react";

const ProductCard = ({ img, model, oldPrice, newPrice, availability }) => {
  return (
    <div className="product-card">
      <div className="product-image">
        <img src={img} alt={model} />
      </div>
      <div className="product-description">
        <p className="product-model">{model}</p>
      </div>
      <div className="product-price">
        {oldPrice && <span className="price-old">{oldPrice} Br</span>}
        <span className="price-new">{newPrice} Рублей</span>
      </div>
      <div className="product-availability">{availability}</div>
      <button className="product-order">Заказать</button>
    </div>
  );
};

export default ProductCard;
